Autorizo expressamente %s a realizar as investigações necessárias sobre meu comportamento e histórico creditício junto às Sistemas de Informação de Crédito (SCR) que julgar apropriadas. 

Declaro que os presentes termos estão de acordo com a Lei No. 12.414, de 9 de Junho de 2011, que disciplina a formação e consulta a bancos de dados com informações de adimplemento, de pessoas naturais ou de pessoas jurídicas, para formação de histórico de crédito.

Os presentes Termos e Condições de Uso e Política de Privacidade e os demais documentos da Mati estão de acordo com Código de Defesa do Consumidor, o Marco Civil da Internet e Lei de Sigilo Bancário.
Da mesma forma, declaro que conheço a natureza e o escopo das empresas de informação de crédito e as informações contidas nos relatórios de crédito e relatórios especiais de crédito; declaro que conheço a natureza e o escopo das informações que serão solicitadas, o uso que a %s fará de tais informações e que a %s poderá fazer consultas periódicas sobre minha história ou a da empresa que represento, consentindo que esta autorização seja válida por um período de 5 anos contados a partir de sua emissão e, em qualquer caso, durante o tempo em que a relação jurídica for mantida.

Informações específicas dos Usuários

1. Esta seção especifica quais informações devem ser disponibilizadas pelos Usuários e verificadas pela Paketá Consignado no ato do cadastramento dos Usuários e em preparação para as operações de empréstimo consignado privado, oportunidade em que outros documentos e informações poderão ser solicitados, inclusive para fins da análise de crédito do Tomador, bem como para realização de procedimentos de conheça-o-seu-cliente e anti-lavagem de dinheiro.
2. Todas as informações requeridas estão de acordo com o disposto na Lei Complementar nº 105 de 10 janeiro de 2001, a qual dispõe sobre o sigilo das operações de instituições financeiras.
3. Os presentes Termos e Condições de Uso e Política de Privacidade e os demais documentos da Paketá Consignado estão de acordo com Código de Defesa do Consumidor, o Marco Civil da Internet e Lei de Sigilo Bancário.
4. Você garante que todas as informações que fornecer na Plataforma Digital da Paketá são verdadeiras e precisas em todos os aspectos. Você nos informará se alguma das informações que você forneceu for alterada ou atualizada. A Plataforma Digital da Paketá não é responsável por qualquer informação não-verdadeira ou desatualizada fornecida pelos Usuários.

Informações que coletamos exclusivamente dos Tomadores

Você está ciente e, neste ato, concorda que a análise de crédito e a veiculação de sua solicitação na Plataforma Digital da Paketá depende de diversas informações disponibilizadas pelo Tomador, tais como valor solicitado, prazo em meses estimado para pagamento, utilidade pretendida ao crédito solicitado, e histórico do Tomador. Para determinar estas informações, é preciso que o Tomador forneça as seguintes informações e, neste ato, você concorda que a Paketá Consignado poderá coletar, armazenar, tratar e usar as informações a seguir para as finalidades dispostas nestes Termos e Condições de Uso e Política de Privacidade:

1. nome completo;
2. CPF;
3. RG, órgão emissor e estado da emissão;
4. data de nascimento;
5. número de filho;
6. estado civil;
7. dados bancários;
8. dados profissionais como data de admissão, salário bruto, salário líquido e empresa onde trabalha;
9. selfie, ou seja, foto de rosto de você;
10. foto frente e verso do documento de identificação (RG ou CNH);
11. foto do comprovante de renda;
12. foto do comprovante de endereço;
13. número de telefone residencial, telefone celular e endereço de e-mail;
14. endereço residencial completo;
15. senha de acesso escolhida;
16. cédula de crédito bancário assinada eletronicamente;
17. mensagens trocadas com a Plataforma Digital da Paketá via e-mail ou push no aplicativo;
18. comentários e quaisquer outras informações disponibilizadas nos grupos de discussão e redes sociais da Plataforma Digital da Paketá;
19. informações referentes aos serviços solicitados e atividades realizadas na Plataforma Digital da Paketá.
